std::unique_ptr<uint32_t[]> PCSX::GUI::getSplashScreen(uint32_t destWidth, uint32_t destHeight) {
    const uint32_t srcWidth = s_splashImageData[0];
    const uint32_t srcHeight = s_splashImageData[1];
    const uint32_t* srcPixels = &s_splashImageData[2];

    auto resizedPixels = std::make_unique<uint32_t[]>(destWidth * destHeight);

    // Resize splash image
    stbir_resize_uint8_linear(reinterpret_cast<const unsigned char*>(srcPixels), srcWidth, srcHeight, 0,
    reinterpret_cast<unsigned char*>(resizedPixels.get()), destWidth, destHeight, 0,
    STBIR_RGBA);

    return resizedPixels;
}